function Planner() {
  return (
    <div style={{
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      minHeight: "100vh",
      fontFamily: "Arial, sans-serif",
      textAlign: "center"
    }}>
      <h2>Welcome to your Planner Page!</h2>
      <p>Here you can add your financial planning tools.</p>
    </div>
  );
}

export default Planner;
